import React from "react";
import { NavLink } from "react-router-dom";

export default function Nav() {
  //this doesn't work... if you navigate without clicking...
  //istead maybe use params? to have teh variable for the page? or just state?

  return (
    <nav>
      <ul>
        <li>
          <NavLink className="nav-link" className="hi" to="/">
            Homepage
          </NavLink>
        </li>
        <li>
          <NavLink className="nav-link" className="hi" to="/data/add">
            Add Data
          </NavLink>
        </li>
        <li>
          <NavLink className="nav-link" className="hi" to="/data/tag">
            Tag Data
          </NavLink>
        </li>
      </ul>
    </nav>
  );
}
